INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "クローチェ", -470.0, 10001, 2002, 0.0, 1, 2, 126401, 1, 1.47, "2023/09/22 14:59:59", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", "2023/06/30 12:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "クローチェ", -470.0, 10002, 2002, 0.0, 1, 1, 126401, 2, 2.15, "2023/09/22 14:59:59", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", "2023/06/30 12:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ライラエル", -470.0, 10003, 2002, 0.0, 1, 2, 126501, 1, 0.0, "2023/09/22 14:59:59", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", "2023/06/30 12:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ライラエル", -470.0, 10004, 2002, 0.0, 1, 1, 126501, 2, 0.0, "2023/09/22 14:59:59", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", "2023/06/30 12:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "リンド", -470.0, 10005, 2002, 0.0, 2, 2, 127702, 1, 0.0, "2023/12/22 14:59:59", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", "2023/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "リンド", -470.0, 10006, 2002, 0.0, 2, 2, 127702, 2, 0.0, "2023/12/22 14:59:59", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", "2023/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ヴルム", -470.0, 10007, 2002, 0.0, 2, 1, 127802, 1, 0.0, "2023/12/22 14:59:59", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", "2023/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ヴルム", -470.0, 10008, 2002, 0.0, 2, 1, 127802, 2, 6.5, "2023/12/22 14:59:59", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", "2023/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "アネモネ", -470.0, 10009, 2002, 0.0, 3, 1, 129602, 1, 0.0, "2024/03/22 14:59:59", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", "2023/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "アネモネ", -470.0, 10010, 2002, 0.0, 3, 1, 129602, 2, 0.0, "2024/03/22 14:59:59", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", "2023/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ネフィ=ネラ", -470.0, 10011, 2002, 0.0, 3, 1, 129701, 1, 0.0, "2024/03/22 14:59:59", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", "2023/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ネフィ=ネラ", -470.0, 10012, 2002, 0.0, 3, 1, 129701, 2, 6.2, "2024/03/22 14:59:59", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", "2023/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (3, "カノン", -470.0, 10013, 2002, 0.0, 4, 5, 130301, 1, 3.1, "2024/06/22 14:59:59", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "2024/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (3, "カノン", -470.0, 10014, 2002, 0.0, 4, 2, 130301, 2, 6.15, "2024/06/22 14:59:59", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", "2024/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ナーナ", -470.0, 10015, 2002, 0.0, 4, 2, 130401, 1, 0.0, "2024/06/22 14:59:59", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", "2024/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ナーナ", -470.0, 10016, 2002, 0.0, 4, 1, 130401, 2, 3.35, "2024/06/22 14:59:59", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", "2024/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ホウオウ", -470.0, 10017, 2002, 0.0, 5, 1, 130502, 1, 0.0, "2024/09/22 14:59:59", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", "2024/06/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ホウオウ", -470.0, 10018, 2002, 0.0, 5, 1, 130502, 2, 3.18, "2024/09/22 14:59:59", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", "2024/06/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (4, "ホウオウ", -470.0, 10019, 2002, 0.0, 5, 4, 130503, 3, 0.0, "2024/09/22 14:59:59", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", "2024/06/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ネア", -470.0, 10020, 2002, 0.0, 5, 2, 123301, 1, 4.9, "2024/09/22 14:59:59", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", "2024/06/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ネア", -470.0, 10021, 2002, 0.0, 5, 2, 123301, 2, 4.8, "2024/09/22 14:59:59", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", "2024/06/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (3, "カリザ", -470.0, 10022, 2002, 0.0, 6, 1, 133301, 1, 4.922, "2024/12/22 14:59:59", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", "2024/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (3, "カリザ", -470.0, 10023, 2002, 0.0, 6, 5, 133301, 2, 9.638, "2024/12/22 14:59:59", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", "2024/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ミーア", -470.0, 10024, 2002, 0.0, 6, 2, 133401, 1, 2.88, "2024/12/22 14:59:59", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", "2024/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (5, "ミーア", -470.0, 10025, 2002, 0.0, 6, 1, 133401, 2, 4.818, "2024/12/22 14:59:59", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", "2024/09/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "グレイス", -470.0, 10026, 2002, 0.0, 7, 1, 133002, 1, 1.78, "2025/03/22 14:59:59", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", "2024/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "グレイス", -470.0, 10027, 2002, 0.0, 7, 7, 133002, 2, 6.15, "2025/03/22 14:59:59", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", "2024/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (6, "ヴァイオレット", -470.0, 10028, 2002, 0.0, 7, 2, 133102, 1, 4.28, "2025/03/22 14:59:59", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", "2024/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "ヴァイオレット", -470.0, 10029, 2002, 0.0, 7, 1, 133102, 2, 0.0, "2025/03/22 14:59:59", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", "2024/12/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ルルィ", -470.0, 10030, 2002, 0.0, 8, 1, 136902, 1, 5.53, "2025/06/23 14:59:59", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", "2025/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (9, "ルルィ", -470.0, 10031, 2002, 0.0, 8, 7, 136902, 2, 6.05, "2025/06/23 14:59:59", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", "2025/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "デュラン", -470.0, 10032, 2002, 0.0, 8, 1, 137001, 1, 0.0, "2025/06/23 14:59:59", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", "2025/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "デュラン", -470.0, 10033, 2002, 0.0, 8, 1, 137001, 2, 0.0, "2025/06/23 14:59:59", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", "2025/03/15 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "サツキ", -470.0, 10034, 2002, 0.0, 9, 2, 135902, 1, 0.0, "2025/09/23 14:59:59", "おう\n好きなもん持ってきな", "2025/06/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "サツキ", -470.0, 10035, 2002, 0.0, 9, 6, 135902, 2, 4.935, "2025/09/23 14:59:59", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", "2025/06/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ユキノ", -470.0, 10036, 2002, 0.0, 9, 5, 135802, 1, 7.441, "2025/09/23 14:59:59", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", "2025/06/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (7, "ユキノ", -470.0, 10037, 2002, 0.0, 9, 7, 135802, 2, 0.0, "2025/09/23 14:59:59", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", "2025/06/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "クルル", -470.0, 10038, 2002, 0.0, 10, 2, 130901, 1, 2.295, "2025/12/23 14:59:59", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", "2025/09/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (1, "クルル", -470.0, 10039, 2002, 0.0, 10, 6, 130901, 2, 6.281, "2025/12/23 14:59:59", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", "2025/09/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (2, "ヴォルガーノ", -470.0, 10040, 2002, 0.0, 10, 1, 137701, 1, 5.549, "2025/12/23 14:59:59", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", "2025/09/16 15:00:00");
INSERT INTO `v1_9f9e19c6f3d09cd68722beb0fe8044e4eda61addfef4a31fa380174226199df3` VALUES (3, "ヴォルガーノ", -470.0, 10041, 2002, 0.0, 10, 6, 137701, 2, 2.64, "2025/12/23 14:59:59", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", "2025/09/16 15:00:00");
